import React from "react";
import "../page/style/RightBox.css";

function RightBox() {
  return (
    <div className="RightBox">
      <div className="best-box">
        <div className="best-name-box">최근 게시물</div>
        <div className="best-content-box">
          <div>content</div>
          <div>date</div>
        </div>
        <div className="best-content-box">
          <div>content</div>
          <div>date</div>
        </div>
      </div>
    </div>
  );
}

export default RightBox;
